def _get_time_bins(self, ax):

    if not isinstance(ax, DatetimeIndex):
        raise TypeError(
            "axis must be a DatetimeIndex, but got "
            f"an instance of {type(ax).__name__}"
        )

    if len(ax) == 0:
        binner = labels = DatetimeIndex(data=[], freq=self.freq, name=ax.name)
        return binner, [], labels

    ax_values = ax.asi8

    # Fix for ambiguous times during DST changes
    if ax.tz is not None and ax.tz._utc_transition_times is not None:
        for transition_time in ax.tz._utc_transition_times:
            if ax.min() <= transition_time < ax.max():
                idx = np.argmax(ax_values >= transition_time)
                ax_values = np.insert(ax_values, idx, transition_time)

    first, last = ax_values.min(), ax_values.max()

    binner, bin_edges = date_range(
        freq=self.freq,
        start=first,
        end=last,
        closed=self.closed,
        ambiguous="infer",
    )
    binner = binner.tz_localize(ax.tz)
    bin_edges = bin_edges.tz_localize(ax.tz)

    binner, bin_edges = self._adjust_bin_edges(binner, ax_values, bin_edges)

    # general version, knowing nothing about relative frequencies
    bins = lib.generate_bins_datetime64(
        ax_values, bin_edges, self.closed, has_nans=ax.hasnans
    )

    if self.closed == "right":
        labels = binner[1:]
        if self.label == "right":
            labels = labels[1:]
    elif self.label == "right":
        labels = binner[1:]

    if ax.hasnans:
        binner = binner.insert(0, NaT)
        labels = labels.insert(0, NaT)

    # if we end up with more labels than bins
    # adjust the labels
    if len(bins) < len(labels):
        labels = labels[: len(bins)]

    return binner, bins, labels
